syntax="proto3";

package response;

option java_multiple_files = true;
option java_package = "com.gini.request";

import "response/type-response.proto";
import "response/versionResponse.proto";


message CarResponse{

  string id = 1;
  string model = 2;
  string manufacturer = 3;
  response.VersionResponse version = 4;



}
